 s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"51710","type":"Paragraph"},{"attributes":{"below":[{"id":"51335"}],"center":[{"id":"51338"},{"id":"51342"}],"left":[{"id":"51339"}],"plot_height":320,"renderers":[{"id":"51360"},{"id":"51367"}],"title":{"id":"51325"},"toolbar":{"id":"51350"},"x_range":{"id":"51327"},"x_scale":{"id":"51331"},"y_range":{"id":"51329"},"y_scale":{"id":"51333"}},"id":"51324","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"51333","type":"LinearScale"},{"attributes":{"axis":{"id":"51339"},"dimension":1,"ticker":null},"id":"51342","type":"Grid"},{"attributes":{},"id":"51331","type":"LinearScale"},{"attributes":{},"id":"51340","type":"BasicTicker"},{"attributes":{"axis":{"id":"51335"},"ticker":null},"id":"51338","type":"Grid"},{"attributes":{},"id":"51578","type":"PanTool"},{"attributes":{"fill_color":{"value":"white"},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":2},"x":{"field":"x"},"y":{"field":"y"}},"id":"51318","type":"Circle"},{"attributes":{"source":{"id":"51317"}},"id":"51321","type":"CDSView"},{"attributes":{"ticks":[1584403200000.0,1585008000000.0,1585612800000.0,1586217600000.0,1586822400000.0,1587427200000.0,1588032000000.0,1588636800000.0,1589241600000.0,15
